import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'TestNarrTx';
  narrativeText: string = '';
  maxLength: number = 4000;

  getSuggestion(): void {
    console.log('Getting suggestion for:', this.narrativeText);
    // Add your suggestion logic here
  }

  get remainingCharacters(): number {
    return this.maxLength - this.narrativeText.length;
  }
}
<div class="container">
  <header class="header">
    <h1>narrativetx</h1>
  </header>

  <main class="main-content">
    <div class="input-section">
      <label for="narrative-input" class="input-label">
        Enter Narrative Text
      </label>

      <textarea 
        id="narrative-input"
        class="narrative-input"
        [(ngModel)]="narrativeText"
        [maxlength]="maxLength"
        placeholder="Type your narrative text here..."
        rows="10"
      ></textarea>

      <div class="character-counter">
        {{ narrativeText.length }} / {{ maxLength }} characters
        <span class="remaining" [class.warning]="remainingCharacters < 100">
          ({{ remainingCharacters }} remaining)
        </span>
      </div>

      <button 
        class="suggestion-button"
        (click)="getSuggestion()"
        [disabled]="narrativeText.length === 0"
      >
        Get Suggestion
      </button>
    </div>
  </main>
</div>
